import React from "react";
import { GoogleMap, Marker } from "react-google-maps";
const FindLib = (props) => {
  return (
    <div className="flex w-full">
      <div className="w-1/3">Find Library</div>
      <div className="w-2/3">
        <GoogleMap
          defaultZoom={8}
          defaultCenter={{ lat: 33.684566, lng: -117.826508 }}
        />
      </div>
    </div>
  );
};

export default FindLib;
